function extractResults() {
  const container = document.querySelector('.content-tile');
  if (!container) return [];
  const blocks = Array.from(container.children).filter(el => el.matches('.brand-k, .brand-n, .brand-r'));
  return blocks.map((el, idx) => {
    const urlEl = el.querySelector('h2 a[href]');
    const titleEl = urlEl;
    const summaryEl = el.querySelector('span[style*="overflow-wrap"], span[style *= "overflow-wrap"]');
    const footer = el.querySelector('footer');
    let publishedAt = '';
    let source = '';
    if (footer) {
      const dateEl = footer.querySelector('span');
      if (dateEl) {
        // Dates are in dd.mm.yyyy, convert to ISO
        const m = dateEl.textContent.match(/(\d{2})\.(\d{2})\.(\d{4})/);
        if (m) publishedAt = `${m[3]}-${m[2]}-${m[1]}`;
      }
      // Extract first tag (as source)
      const sourceEl = footer.querySelector('a[rel="tag"]');
      if (sourceEl) source = sourceEl.textContent.trim();
    }
    return {
      id: urlEl ? urlEl.getAttribute('href') : '',
      url: urlEl ? urlEl.href : '',
      title: titleEl ? titleEl.textContent.trim() : '',
      summary: summaryEl ? summaryEl.textContent.trim() : '',
      publishedAt: publishedAt,
      source: source,
      position: idx + 1
    };
  });
}
